id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object. 
The path to the parameters file can be an absolute or relative path to a file.
CF_NAME update-service -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
  Si vous le souhaitez, fournissez des paramètres de configuration propres au service dans un objet JSON valide en ligne.
CF_NAME update-service -c '{"nom":"valeur","nom":"valeur"}'

  Si vous le souhaitez, fournissez un fichier contenant des paramètres de configuration propres au service dans un objet JSON valide. 
  Le chemin d'accès au fichier de paramètres peut être absolu ou relatif.
  CF_NAME update-service -c CHEMIN_FICHIER

  Exemple d'objet JSON valide :
  {
     "cluster_nodes": {
        "count": 5,
"memory_mb": 1024
     }
  }

id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line:

CF_NAME create-service SERVICE PLAN SERVICE_INSTANCE -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object.
The path to the parameters file can be an absolute or relative path to a file:

CF_NAME create-service SERVICE PLAN SERVICE_INSTANCE -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
  Si vous le souhaitez, vous pouvez fournir des paramètres de configuration propres au service dans un objet JSON valide en ligne :

  CF_NAME create-service SERVICE PLAN INSTANCE_SERVICE -c '{"nom":"valeur","nom":"valeur"}'

  Si vous le souhaitez, fournissez un fichier contenant des paramètres de configuration propres au service dans un objet JSON valide.
  Le chemin d'accès au fichier de paramètres peut être absolu ou relatif :

  CF_NAME create-service SERVICE PLAN INSTANCE_SERVICE -c CHEMIN_FICHIER

  Exemple d'objet JSON valide :
  {
"cluster_nodes": {
        "count": 5,
        "memory_mb": 1024
     }
  }

